              username: active_tab.data.new_member.email,
              // password: thisObj.generate_random_password()
              medusa_password: generate_random_password(),
              password: "P@ssW3rd9756",
              users: [auth.user],
              friends: [auth.user],
              addresses: {
                shipping: [],
